VALUES

    (2,'Bienvenida con los Looney Tunes','Estos queridos personajes estarán recibiendo a los asistentes con una divertida y colorida presentación que inyectará energía desde el inicio de la visita.','Quiosco Pueblo Mexicano','10:00:00','11:30:00','2020-01-01','2020-12-30'),
    (1,'DC Colors','Los integrantes de la Liga de la Justicia mostrarán sus cualidades y habilidades para combatir el mal y a los villanos que se atrevan a irrumpir con la diversión.','Villa Hollywood','11:30:00','12:30:00','2020-04-01','2020-05-28'),
    (10,'Looney Tunes Color Time','Polvos de colores, confetti y encanto estarán presentes en este encuentro en donde se podrá tomar foto, cantar y abrazar a los personajes favoritos en el Castillo de los Sueños.','Castillo de los Sueños','12:30:00','13:30:00','2020-04-01','2020-05-28'),
    (1,'Colors Party','Un grandioso performance con destellos de colores y con la presencia de un DJ, se encargará de hacer bailar a todas y todos los visitantes con sets llenos de energía y ritmos contagiosos.','Villa Hollywood','13:30:00','15:30:00','2020-04-01','2020-05-28'),
    (1,'Héroes y Villanos Parade','Al finalizar un día lleno de emociones, un impactante desfile será el broche de oro y estará acompañado de diferentes personajes, héroes y villanos que realizarán detonaciones multicolores y contagiarán a más de uno a unirse a esta fiesta sin igual.','Villa Hollywood','16:30:00','20:30:00','2020-04-01','2020-05-28'),
    (4,'Música en vivo','Se podrá bailar y cantar con éxitos en inglés y en español con una sensacional coverband que los llevará a un viaje musical acompañado de luces, colores, sonidos y gran performance.','Pueblo Francés','08:00:00','23:00:00','2020-03-08','2020-05-26'),
    (2,'Mariachi','No hay persona que no se rinda ante las interpretaciones de un buen mariachi que haga gozar, cantar a todo pulmón y vivir la pasión e identidad mexicana en medio del pintoresco pueblo mexicano.','Pueblo Mexicano','08:00:00','23:00:00','2020-03-08','2020-05-26'),
    (2,'Fotos con personajes','Hermosos personajes multicolor, catrinas y hasta zombies estarán saludando y tomándose fotos con los visitantes que buscan un grato recuerdo y complemento especial a su día.','Pueblo Mexicano','08:00:00','23:00:00','2020-04-13','2020-04-16'),
    (6,'La ruta caníbal','La calma del bosque termina para la extraña familia que habita en una vieja cabaña, cuando la civilización se quiere abrir paso construyendo una ruta que acaba con la tranquilidad. Pero esta misteriosa y peculiar familia no se quedará tranquila hasta vengarse de todos los que pasen por la carretera.','Motosierras','11:00:00','22:40:00','2020-09-12','2020-10-10'),
    (6,'Mazmorras','Debajo de la tierra, existe un oscuro inframundo. En éste, habitan unas temibles gárgolas sedientas de dolor y temor para sobrevivir. Ellas se ocultan en las tinieblas y esperan por algún alma que torturar.','Motosierras','11:00:00','22:40:00','2020-09-12','2020-10-10'),
    (4,'Terror en Paris','La Ciudad de la Luz oculta en lo más profundo de sus entrañas una huella siniestra de sangre y guerra, un recuerdo de las atrocidades que alguna vez se cometieron. Entra y jamás podrás salir.','Pueblo Francés','11:00:00','22:40:00','2020-09-12','2020-10-10'),
    (7,'Espantapájaros','Existen sembradíos resguardados por un viejo espantapájaros. Su trabajo es sencillo: ahuyentar a las aves. Pero si se confía al cruzar esos terrenos, ¡todos los intrusos pagan un precio muy alto!','Calabajack','11:00:00','22:40:00','2020-09-12','2020-10-10'),
    (9,'La Prisión','Seres deformes, perversos y agresivos son el resultado de pruebas realizadas a los reos que habitaban esta prisión. Han pasado años desde su clausura y nadie sabe que paso con ellos. Se buscan voluntarios para limpiar esta ubicación.','Esqueletos','11:00:00','22:40:00','2020-09-12','2020-10-10'),
    (2,'Leyendas de México','Hay veces que las Leyendas se pueden volver realidad…buscarlas se puede volver tu peor pesadilla. ¡No busques lo que no quieres encontrar!','Pueblo Zombie','11:00:00','22:40:00','2020-09-12','2020-10-10'),
    (9,'Catástrofe ','Un científico realiza experimentos de manera clandestina sin conocer las consecuencias…¿Te atreves a descubrir lo que puede suceder?','esqueletos','11:00:00','22:40:00','2020-09-12','2020-10-10'),
    (7,'Región Extraterrestre','Hay secretos que durante mucho tiempo han sido ocultos por la humanidad, pero la verdad esta a punto de ser revelada y quizás esto pueda representar el final…o el comienzo de una nueva era …¿Te atreverás a descubrirla?','Calabajack','11:00:00','22:40:00','2020-09-12','2020-10-10'),
