    (3,'Dulce Callejón','Personajes como Bugs Bunny, Pato Lucas o Silvestre, recibirán con una rica sorpresa a cada niño y niña que toque la puerta de su casa gritando la tradicional frase: ¡Dulce o Truco!','Bugs Bunny Boomtown','11:00:00','22:00:00','2023-09-12','2023-10-10'),
    (4,'¡Hay brujas en Six Flags México!','Con el afán de seguir creando recuerdos memorables para toda la familia, Six Flags México inaugura un encantador espacio llamado:¡Hay brujas en Six Flags México!','Escenario de Pueblo Francés','10:00:00','10:45:00','2023-09-12','2023-10-10'),
    (10,'Salón de las Princesas','Un maravilloso espacio en donde las niñas podrán convertirse en verdaderas y encantadoras princesas salidas de un cuento de hadas y los niños en heroicos y valientes caballeros de la corona.','Castillo de los Sueños','10:00:00','19:00:00','2023-01-01','2023-12-31'),
    (10,'Fábrica de los Bloques del Castillo','Una divertida habitación en la cual niños y niñas no tendrán límites a su imaginación y serán ayudados por bloques de juguete de diferentes tamaños y colores donde podrán hacer estructuras de ensueño.','Castillo de los Sueños','10:00:00','19:00:00','2023-01-01','2023-12-31'),
    (10,'Cueva del Slime del Dragón','Una increíble estancia en donde habrá muchas maneras de jugar por medio de la creación de slime de diferentes texturas y colores que el dragón del castillo ha colocado ahí para los pequeños visitantes.','Castillo de los Sueños','10:00:00','19:00:00','2023-01-01','2023-12-31'),
    (4,'Beyond Christmas','Una espectacular presentación que dará inicio al encendido de millones de luces por el parque, acompañada de un emotivo número musical, presencia de Looney Tunes y maravillosos fuegos artificiales.','Escenario de Pueblo Francés','21:00:00','22:00:00','2023-11-24','2024-01-21'),
    (4,'Christmas Light Parade','El tradicional y querido desfile que recorrerá los pasillos del parque en compañía de comparsas, música y grandiosos personajes.','De Villa Hollywood a Pueblo Vaquero, Escenario de Pueblo Francés','21:30:00','23:30:00','2023-11-24','2024-01-21'),
    (2,'Despedida con la Liga de la Justicia','Tus superhéroes favoritos te acompañan a terminar un día lleno de magia y diversión.','Pueblo Mexicano','18:00:00','23:59:59','2023-11-24','2024-01-21'),
    (4,'Despedida con los personajes navideños y Looney Tunes.','El día termina con la compañía de los personajes más fantásticos y nuestros queridos Looney Tunes.','Explanada de Pueblo Francés','17:00:00','23:59:59','2023-11-24','2024-01-21'),
    (10,'El Milagro de la Navidad','Un videomapping acompañado con los Looney Tunes y sus amigos que encenderá inimaginables sentimientos en esta Navidad.','19:00:00','Castillo de los Sueños','22:30:00','2023-11-24','2024-01-21'),
    (4,'Jingle Magic Band','Agradable música en vivo que será interpretada por una banda que amenizará y creará un real ambiente navideño.','Escenario de Pueblo Francés','20:00:00','22:00:00','2023-11-24','2024-01-21'),
    (5,'La Casita de Dulces del Polo Norte','Una interactiva atracción que espera a niños y niñas con deliciosos dulces entregados por Santa Claus y sus divertidos duendes.','Bugs Bunny BoomTown','18:00:00','23:00:00','2023-11-24','2024-01-21'),
    (6,'Posadas Caramelo','Un alegre paseo por un pueblo que invitará a los niños y niñas que visitan el parque a pedir posada y recibir sabrosos dulces entregados por los tiernos Looney Tunes.','Pueblo Vaquero','19:38:00','22:40:00','2023-11-24','2024-01-21'),
    (1,'Sesión fotográfica con la Liga de la Justicia','Tus superhéroes favoritos también forman parte de esta mágica temporada, encuéntralos por el parque y llévate el mejor recuerdo.','Explanada DC y Explanada Francés','13:00:00','22:30:00','2023-11-24','2024-01-21'),
    (10,'Sesión fotográfica con las Princesas y Lola Bunny','Vive un momento mágico junto a Lola Bunny y las princesas del Castillo de los Sueños','Castillo de los Sueños','12:00:00','20:00:00','2023-11-24','2024-01-21'),
    (9,'Sesión fotográfica con personajes navideños','Encuentra a los personajes más mágicos y divertidos de la Navidad para llevarte un recuerdo inolvidable.','Explanada de Pueblo Francés, Explanada Crazanity y Villa Navideña','11:00:00','22:00:00','2023-11-24','2024-01-21'),
    (4,'Festival de Sabores ¡ITALIA!','Deleita tus papilas gustativas y prueba hasta 12 platos de siete países diferentes de todo el mundo. ¡Bebe, pasea y disfruta de los Sabores del Mundo!','Explanada Francés','10:00:00','22:00:00','2023-06-23','2023-08-13'),
    (2,'Festival de Sabores ¡GRECIA!','Deleita tus papilas gustativas y prueba hasta 12 platos de siete países diferentes de todo el mundo. ¡Bebe, pasea y disfruta de los Sabores del Mundo!','Pueblo Mexicano','10:00:00','22:00:00','2023-06-23','2023-08-13'),
    (9,'Festival de Sabores ¡CARIBE!','Deleita tus papilas gustativas y prueba hasta 12 platos de siete países diferentes de todo el mundo. ¡Bebe, pasea y disfruta de los Sabores del Mundo!','Explanada Crazanity','10:00:00','22:00:00','2023-06-23','2023-08-13'),
    (2,'Festival de Sabores ¡COREA!','Deleita tus papilas gustativas y prueba hasta 12 platos de siete países diferentes de todo el mundo. ¡Bebe, pasea y disfruta de los Sabores del Mundo!','Pueblo Mexicano','10:00:00','22:00:00','2023-06-23','2023-08-13'),
    (9,'Festival de Sabores ¡INDIA!','Deleita tus papilas gustativas y prueba hasta 12 platos de siete países diferentes de todo el mundo. ¡Bebe, pasea y disfruta de los Sabores del Mundo!','Explanada Crazanity','10:00:00','22:00:00','2023-06-23','2023-08-13'),
    (2,'Festival de Sabores ¡CHINA!','Deleita tus papilas gustativas y prueba hasta 12 platos de siete países diferentes de todo el mundo. ¡Bebe, pasea y disfruta de los Sabores del Mundo!','Pueblo Mexicano','10:00:00','22:00:00','2023-06-23','2023-08-13'),
    (4,'Festival de Sabores ¡FRANCIA!','Deleita tus papilas gustativas y prueba hasta 12 platos de siete países diferentes de todo el mundo. ¡Bebe, pasea y disfruta de los Sabores del Mundo!','Explanada Francés','10:00:00','22:00:00','2023-06-23','2023-08-13'),
    (6,'Vuelta al Mundo por Europa','Bebe alrededor del mundo, elige tu vuelo.','Pueblo Vaquero','10:00:00','22:00:00','2023-06-23','2023-08-13'),
    (9,'Vuelta al Mundo por Japón','Bebe alrededor del mundo, elige tu vuelo.','Pueblo Polinesio','10:00:00','22:00:00','2023-06-23','2023-08-13'),
    (9,'Vuelta al Mundo por el Caribe','Bebe alrededor del mundo, elige tu vuelo.','Explanada Crazanity','10:00:00','22:00:00','2023-06-23','2023-08-13'),
    (4,'Baile Bhangra','Disfruta de los diversos estilos de baile inspirados en las culturas indias. Además, únete a la celebración con clases de baile instructivas.','Explanada de Pueblo Francés','15:00:00','18:00:00','2023-06-23','2023-08-13'),
    (4,'Pan y Vino','Disfruta del ritmo y los beats de una banda de tambores de acero en celebración de las culturas.','Pueblo Francés','14:00:00','17:00:00','2023-06-23','2023-08-13'),
    (3,'Manualidades para Niños','Deja que los más pequeños se unan a la celebración de las culturas con diferentes manualidades y diversión.','DC Super Friends','10:00:00','22:00:00','2023-06-23','2023-08-13'),
    (8,'Encuentro y Saludo LOONEY TUNES','Canta y baila con Bugs Bunny y sus amigos de Looney Tunes con los favoritos de la familia que seguramente te pondrán en el espíritu festivo.','Circo de Bugs Bunny','16:00:00','22:00:00','2023-11-24','2024-01-21')
